    setProgressoInicial(id) {
        console.log(id);
        console.log("setando progresso inicial");
        this.usuarioRef = this.db.object('testes/' + id);
        this.usuarioRef.snapshotChanges().subscribe(res => {
            const dados = res.payload.toJSON();
            console.log(dados);
            this.nivel_aero = dados['aerobico']['nivel'];
            this.nivel_condicionamento_fisico = dados['antropometria']['condicionamento_fisico'];
            this.nivel_flexibilidade = dados['flexibilidade']['flexibilidade'];
            this.nivel_musculo = dados['musculo']['musculo_funcional'];
            let treinos = []; //aerobia,flex,muscular
            if (this.nivel_condicionamento_fisico == "azul")
                treinos = [2, 2, 2, 2];
            if (this.nivel_condicionamento_fisico == "verde")
                treinos = [3, 3, 3, 3];
            if (this.nivel_condicionamento_fisico == "amarelo")
                treinos = [4, 4, 4, 4];
            if (this.nivel_condicionamento_fisico == "vermelho")
                treinos = [5, 5, 5, 5];
            let funcional;
            let funcional2;
            if (dados['funcional'])
                funcional = dados['funcional']['result'];
            if (dados['funcional2'])
                funcional2 = dados['funcional2']['result'];
            let nivel_final;
            if (dados['funcional'] && dados['funcional2'])
                nivel_final = Math.floor((funcional + funcional2 + this.nivel_aero + this.nivel_flexibilidade + this.nivel_musculo) / 5);
            else
                nivel_final = Math.floor((this.nivel_aero + this.nivel_flexibilidade + this.nivel_musculo) / 3);
            console.log(nivel_final);
            this.db.database.ref('progresso_usuario/')
                .child(id).set({
                semana: 1,
                max_semana: 2,
                nivel: nivel_final,
                max_along_final: treinos[3],
                max_along: treinos[0],
                max_resis: treinos[1],
                max_aero: treinos[2],
                dia_aero: '',
                dia_along: '',
                dia_resis: '',
                dia_along_final: '',
                atual_aero: 0,
                atual_resis: 0,
                atual_along: 0,
                atual_along_final: 0,
                etapa: 'Inicial'
            });
        });
    }
